const CountryReducer = (state) => {
  switch (action.type) {
    case "jpCountry":
      return {
        country: "Japan",
      };
    case "phCountry":
      return {
        country: "Philippines",
      };
    default:
      throw new Error();
  }
};

export default CountryReducer;
